import { Link } from "react-router-dom";

const EVENT_DETAILS = [
    {id: 'e1', details: 'Event 1'},
    {id: 'e2', details: 'Event 2'},
    {id: 'e3', details: 'Event 3'},
]


function EventPage() {
    return (
        <h1>
            <Link to="/event">Event</Link>
        </h1>
    )
};

export default EventPage();
